import Layout from "../components/Layout";
import Link from "next/link";

const Index = () => {
  return (
    <Layout>
      <h1>내 친구들을 소개할게</h1>
      <Link href="./Yeom">
        <a>염재선</a>
      </Link>
      <Link href="./Kang">
        <a>강수호</a>
      </Link>
      <Link href="./Kim">
        <a>김유성</a>
      </Link>
    </Layout>
  );
};

export default Index;
